import React from "react";
import Button from "./Button";

const Nav = () => {
    
    return(
        <div className="w-full h-24 bg-black">
        <h3 className="text-white text-xl px-10 pt-10">fintelogy</h3>
        <ul className="flex justify-center">
            <li className=" px-10 text-white"><a href="/">Home</a></li>
            <li className=" px-10 text-white">Articles</li>
            <li className=" px-10 text-white">Events</li>
            <li className=" px-10 text-white">About</li>
        </ul>
        </div>
    )
}

export default Nav;
